import AtomicHabits from "../images/BooksImg/atomicHabits.jpg";
import DieHard from "../images/BooksImg/DieHard.jpg";
import HungerGames from "../images/BooksImg/TheHungerGames.jpg";
const Columns = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-4">
          <img
            className="img-fluid img-thumbnail rounded d-flex flex-sm-column" style={{height: "auto",maxWidth: "100%"}}
            src={AtomicHabits}
            alt="Atomic Habits.jpg"
          />
        </div>
        <div className="col-md-4">
          <img
            className="img-fluid img-thumbnail rounded d-flex flex-nowrap flex-sm-column"
            src={DieHard}
            alt="Die Hard.jpg"
          />
        </div>
        <div className="col-md-4">
          <img
            className="img-fluid img-thumbnail rounded"
            src={HungerGames}
            alt="Hunger Games.jpg"
          />
        </div>
      </div>
    </div>
  );
};

export default Columns;
